class Q2Task():
    def __init__(self):
        self.rez = {}
        self.threads = {}

    def _worker(self, name):
        self.rez[name] = self.threads[name]['worker'](*self.threads[name]['args'])
    
    def add(self, worker, *args, name=""):
        import random, string, threading
        if name == "" or name in self.threads:
            name = ''.join(random.SystemRandom().choice(string.ascii_uppercase + string.digits) for _ in range(5))
        self.threads[name] = {'worker':  worker, 'args':  args}
        self.threads[name]['thread'] = threading.Thread(target=self._worker, args=(name,))
        self.threads[name]['thread'].start()

    def wait(self):
        for name in self.threads:
            self.threads[name]['thread'].join()
        return self.rez


task = Q2Task()
for x in q2_modules:
    task.add(q2_app.get_package_versions, x, name=x)
print(task.wait())

rez = {}

def cover(rez=rez):
    import threading
    import time

    def thread_it():
       
        def _worker(x, rez, worker):
            rez[x] = worker(x)

        threads = []
        for x in q2_modules:
            thread = threading.Thread(target=_worker, args=(x, rez, q2_app.get_package_versions))
            thread.start()
            threads.append(thread)
            time.sleep(1)
        for thread in threads:
            thread.join()
    return thread_it
   
q2Wait(cover(), "Checking packages...")
print(rez)

